package finddog.model.vo;

public class Kind {
	private String kind;
	private String code;
	public Kind() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Kind(String kind, String code) {
		super();
		this.kind = kind;
		this.code = code;
	}
	public String getKind() {
		return kind;
	}
	public void setKind(String kind) {
		this.kind = kind;
	}
	public String getCode() {
		return code;
	}
	public void setCode(String code) {
		this.code = code;
	}
	
	

}
